import React from "react";

function Dashboard() {
  return (
    <div styl>
      <div
        style={{ height: "100vh", width: "20vw", backgroundColor: "red" }}
      ></div>
      <div
        style={{ height: "100vh", width: "80vw", backgroundColor: "#EDEDED" }}
      ></div>
    </div>
  );
}

export default Dashboard;
